import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import { InputGroup } from 'react-bootstrap';

function TeamForm({ baseURI, pokemons, error, setError }) {
  const [inputErrors, setInputErrors] = useState({});

  const defaultState = {
    name: '',
    member01: '',
    member02: '',
    member03: '',
    member04: '',
    member05: '',
    member06: '',
  };

  const [inputState, setInputState] = useState(defaultState);

  const handleInputChange = (input, value) => {
    const newInputState = { ...inputState, [input]: value };
    setInputState(newInputState);
  };

  /*
  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await fetch(baseURI, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(inputState),
      });
      if (!response.ok) {
        throw new Error(`Error! status: ${response.status}`);
      }

      const data = await response.json();
      const newSubscribers = [...subscribers, data];
      setSubscribers(newSubscribers);
    } catch (e) {
      error = e.message;
      setError(error);
    }
  };
  */

  return (
    <>
      <Form>
        <Form.Group className='mb-3' controlId='name'>
          <Form.Control
            type='text'
            value={inputState.name}
            placeholder='Enter the team name'
            onChange={(e) => {
              console.log(e.target.value);
              handleInputChange(e.target.id, e.target.value);
            }}
            isInvalid={inputErrors.name ? true : false}
          />
          <Form.Control.Feedback type='invalid'>
            {inputErrors.name}
          </Form.Control.Feedback>
        </Form.Group>

        {() => {
          <Form.Group className='mb-3' controlId='member01'>
            <Form.Control
              type='text'
              value={inputState.member01}
              placeholder='Enter a team member'
              onChange={(e) => {
                handleInputChange(e.target.id, e.target.value);
              }}
              isInvalid={inputErrors.name ? true : false}
            />
            <Form.Control.Feedback type='invalid'>
              {inputErrors.name}
            </Form.Control.Feedback>
          </Form.Group>;
        }}

        <Form.Group className='mb-3' controlId='member02'>
          <Form.Control
            type='text'
            value={inputState.member02}
            placeholder='Enter a team member'
            onChange={(e) => {
              handleInputChange(e.target.id, e.target.value);
            }}
            isInvalid={inputErrors.name ? true : false}
          />
          <Form.Control.Feedback type='invalid'>
            {inputErrors.name}
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group className='mb-3' controlId='member03'>
          <Form.Control
            type='text'
            value={inputState.member03}
            placeholder='Enter a team member'
            onChange={(e) => {
              handleInputChange(e.target.id, e.target.value);
            }}
            isInvalid={inputErrors.name ? true : false}
          />
          <Form.Control.Feedback type='invalid'>
            {inputErrors.name}
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group className='mb-3' controlId='member04'>
          <Form.Control
            type='text'
            value={inputState.member04}
            placeholder='Enter a team member'
            onChange={(e) => {
              handleInputChange(e.target.id, e.target.value);
            }}
            isInvalid={inputErrors.name ? true : false}
          />
          <Form.Control.Feedback type='invalid'>
            {inputErrors.name}
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group className='mb-3' controlId='member05'>
          <Form.Control
            type='text'
            value={inputState.member05}
            placeholder='Enter a team member'
            onChange={(e) => {
              handleInputChange(e.target.id, e.target.value);
            }}
            isInvalid={inputErrors.name ? true : false}
          />
          <Form.Control.Feedback type='invalid'>
            {inputErrors.name}
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group className='mb-3' controlId='member06'>
          <Form.Control
            type='text'
            value={inputState.member06}
            placeholder='Enter a team member'
            onChange={(e) => {
              handleInputChange(e.target.id, e.target.value);
            }}
            isInvalid={inputErrors.name ? true : false}
          />
          <Form.Control.Feedback type='invalid'>
            {inputErrors.name}
          </Form.Control.Feedback>
        </Form.Group>

        <div className='text-center'>
          <Button variant='primary' type='submit'>
            Submit
          </Button>
        </div>
      </Form>
    </>
  );
}

export default TeamForm;
